var ukUA={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Дозволити","Allow in your wallet":"Дозволити в гаманці","Allow {symbol} first":["Спочатку дозвольте ",["symbol"]],"Allowance pending":"Надбавка очікується","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Під час спроби виконати цей обмін сталася помилка. Можливо, вам доведеться збільшити толерантність до ковзання. Якщо це не спрацює, можливо, існує несумісність з токеном, яким ви торгуєте. Примітка: плата за перенесення та перебазування токенів несумісні з Uniswap V3.","Approval pending":"Очікує схвалення","Approve":"Схвалити","Approve Permit2":"Approve Permit2","Approve in your wallet":"Підтвердіть у своєму гаманці","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Спершу підтвердьте ",["symbol"]],"Auto":"Автоматично","Auto Router":"Автоматичний маршрутизатор","Auto Router API":"Auto Router API","Balance:":"Баланс:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Закрити","Confirm in your wallet":"Підтвердьте в гаманці","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Підключити гаманець","Connecting…":"Підключення…","Continue":"Continue","Convert {0} to {1}":["Перетворіть ",["0"]," в ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Відключити гаманець","Dismiss":"Відхилити","Enter an amount":"Введіть суму","Error fetching trade":"Помилка отримання торгівлі","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Отримання найкращої ціни…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Високе ковзання збільшує ризик руху ціни","I don't have a wallet":"У мене немає гаманця","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Недостатній баланс ",["0"]],"Invalid recipient":"Недійсний одержувач","Max":"Максимум","Max slippage":"Максимальне ковзання","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Відсутня залежність","Network fee":"Плата за мережу","No results found.":"Результатів не знайдено.","No tokens are available on this network. Please switch to another network.":"У цій мережі немає доступних маркерів. Будь ласка, перейдіть на іншу мережу.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Будь ласка, введіть дійсний % промаху","Powered by the Uniswap protocol":"Працює на основі протоколу Uniswap","Price impact":"Вплив на ціну","Price updated":"Ціна оновлена","Reload":"Reload","Reload the page":"Перезавантажте сторінку","Request rejected":"Request rejected","Review swap":"Обмін огляду","Search by token name or address":"Пошук за назвою або адресою токена","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Сталася помилка","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Успіху","Swap":"Обмін","Swap failed: {0}":["Помилка підкачки: ",["0"]],"Switch network":"Переключити мережу","Switch network in your wallet":"Змініть мережу в гаманці","Switching network":"Комутаційна мережа","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Інваріант Uniswap x * y = k не був задоволений в обміні. Зазвичай це означає, що один із токенів, який ви міняєте, включає спеціальну поведінку при передачі.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Вхідний токен неможливо передати. Можливо, виникла проблема з вхідним токеном.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Вихідний токен неможливо передати. Можливо, виникла проблема з вихідним токеном.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Вихідний токен результату неможливо передати. Можливо, виникла проблема з вихідним токеном результату. Зауважте: комісія за перенесення й перебазування токенів несумісна з Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Ця операція не буде успішною через рух ціни. Спробуйте збільшити свою толерантність до проковзування. Зауважте: комісія за перенесення й перебазування токенів несумісна з Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Ця транзакція не буде успішною ані через рух ціни, ані через комісію за переказ. Спробуйте збільшити свою толерантність до проковзування.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Кінцевий термін транзакції","Transaction rejected":"Трансакцію відхилено","Transaction submitted":"Трансакцію подано","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Спробуйте збільшити толерантність до ковзання.<0/>ПРИМІТКА. Комісія за передачу та перебазування маркерів несумісна з Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Неочікувана помилка. Не вдалося оцінити газ для обміну.","Unexpected issue with estimating the gas. Please try again.":"Неочікувана проблема з оцінкою газу. Будь ласка спробуйте ще раз.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Переглянути на Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"УВАГА","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Ваша транзакція буде повернена, якщо вона була в очікуванні довше, ніж цей період часу.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Вашу транзакцію буде скасовано, якщо ціна зміниться більш ніж на цей відсоток.","minutes":"хвилин","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," комісія"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { ukUA as default };
